  return (
    <div className='overflow-y-scroll h-80'>
      <OtherUser/>
      <OtherUser/>
      <OtherUser/>
      <OtherUser/>
      <OtherUser/>
      <OtherUser/>
      <OtherUser/>
    </div>
  )
}

export default OtherUsers
